import axios from "axios";

const Api = axios.create({baseURL:'http://indoor.lcprojects.net/api', headers:{'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8', 'Accept': '*/*'}, method:'POST', data:{nome:'luan', senha:'luan123'}})

export default Api;
